import { Button, Container, Row } from "react-bootstrap"



const Header = () => {
    return (
        <Container fluid className="bg-dark text-white text-center">
            <Row>
            <Button>+</Button>
            <h1 style={{paddingTop: '70px',paddingBottom: '70px'}}>Vega project Admin</h1>
            </Row>
        </Container>
    )
}


export default Header
